{% block title %}New Torneig{% endblock %}
{% block style %}
    <style>
        .slider {
            margin-top: 20px;
            -webkit-appearance: none;
            width: 100%;
            height: 25px;
            background: #d3d3d3;
            outline: none;
            opacity: 0.7;
            -webkit-transition: .2s;
            transition: opacity .2s;
        }

        .slider:hover {
            opacity: 1;
        }

        .slider::-webkit-slider-thumb {
            -webkit-appearance: none;
            appearance: none;
            width: 25px;
            height: 25px;
            background: #4CAF50;
            cursor: pointer;
        }

        .slider::-moz-range-thumb {
            width: 25px;
            height: 25px;
            background: #4CAF50;
            cursor: pointer;
        }
    </style>
{% endblock %}
{% block body %}

    <section class=\"container s \">
        <div class=\"columns is-multiline\">

            <div class=\"column is-8 is-offset-2 register\">

                <div class=\"columns\">
                    <div class=\"column right has-text-centered\">
                        <h1>Create new Torneig</h1>

                        {{ include('torneig/_form.html.twig') }}

                        <a href=\"{{ path('torneig_index') }}\">back to list</a>
                    </div>



                </div>
            </div>
        </div>
    </section>
